import React from 'react';
import '../styles.css';
import 'bootstrap/dist/css/bootstrap.min.css';
//import Navbar from '../components/NavBar'
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Link, Route, Switch } from 'react-router-dom';

import Home  from '../views/Home'
import About from '../views/About'
import Current from '../views/Current'
import Portfolio from '../views/Portfolio'

const sections = [
  {title: 'Home', route:'/home', componet: <Home />}, 
  {title: 'About', route:'/about', componet: <About />}, 
  {title: 'Currently Reading', route:'/current', componet: <Current />}, 
  {title: 'Portfolio', route:'/portfolio', componet: <Home />},
]

function App() {
  return (
    <div className="App">
      {/* <Navbar sections={sections} /> */}
      <Navbar bg="dark" expand="lg" variant="dark">
        <Navbar.Brand href="#home">Molly N Weybright</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
          {sections.map((section) => (
            <Nav.Link as={Link} to={section.route}>
              {section.title}
            </Nav.Link>
          ))}
          </Nav>
        </Navbar.Collapse>
      </Navbar>
      <div>
        <Switch>
          {sections.map((section) => (
            <Route exact path={section.route}>
              {section.component}
            </Route>
          ))}
        </Switch>
      </div>
      {/* <Footer /> */}
    </div>
  );
}

export default App;
